import { useState } from "react";
import { ALERT_EMPHASES } from "./AlertSettings";
import Alert from "./Alert";
import './App.scss';

function App() {
  const [emphasis, setEmphasis] = useState("info");
  const [headerText, setHeaderText] = useState("Header");
  const [bodyText, setBodyText] = useState("Body");
  const [actionLabel, setActionLabel] = useState("Action Link");
  const [lighterBackground, setLighterBackground] = useState(false);
  const [stroke, setStroke] = useState(false);
  const [iconColor, setIconColor] = useState(false);
  const [isDismissable, setIsDismissable] = useState(true);

  function handleOnClick() {
    console.log("you clicked me!");
  }

  return (
    <div className="App">
      <div className="section setup">
        <div className="section--header">
          <h1>Setup</h1>
          <button
            className="reset-button"
            onClick={handleOnClick}
          >
            Reset
          </button>
        </div>
        <div className="section--main">
          <div>
            <div className="setup--block">
              <p className="label">Emphasis</p>
              {ALERT_EMPHASES.map(option => (
                <label>
                  <input
                    type="radio"
                    name="emphasis"
                    id={option}
                    value={option}
                    checked={option === emphasis}
                    onChange={event => {
                      setEmphasis(event.target.value)
                    }}
                  />
                  {option}
                </label>
              ))}
            </div>
            <div className="setup--block">
              <p className="label">New Alert Options</p>
              <label>
                <input
                  type="checkbox"
                  checked={lighterBackground}
                  onChange={event => {
                    setLighterBackground(event.target.checked)
                  }}
                />
                Lighter background
              </label>
              <label>
                <input
                  type="checkbox"
                  checked={stroke}
                  onChange={event => {
                    setStroke(event.target.checked)
                  }}
                />
                Stroke
              </label>
              <label>
                <input
                  type="checkbox"
                  checked={iconColor}
                  onChange={event => {
                    setIconColor(event.target.checked)
                  }}
                />
                Colored Icon
              </label>
            </div>
          </div>
          <div>
            <div className="setup--block">
              <label>
                <p className="label">Header Text (Optional)</p>
                <input
                  value={headerText}
                  onChange={e => setHeaderText(e.target.value)}
                  placeholder="Header"
                />
              </label>
            </div>
            <div className="setup--block">
              <label>
                <p className="label">Body Text</p>
                <textarea
                  value={bodyText}
                  onChange={e => setBodyText(e.target.value)}
                  placeholder="Body"
                  rows={5}
                />
              </label>
            </div>
            <div className="setup--block">
              <label>
                <p className="label">Action Link Label (Optional)</p>
                <input
                  value={actionLabel}
                  onChange={e => setActionLabel(e.target.value)}
                  placeholder="Action Link"
                />
              </label>
            </div>
            <div className="setup--block">
              <label>
                <p className="label">Dismissable</p>
                <input
                  type="checkbox"
                  checked={isDismissable}
                  onChange={event => {
                    setIsDismissable(event.target.checked)
                  }}
                />
                Dismissable
              </label>
            </div>
          </div>
        </div>
      </div>

      <div className="section examples">
        <h1 className="section--header">
          Examples
        </h1>
        <div className="section--main">
          <div className="example">
            <p className="label">Current</p>
            <Alert
              action={actionLabel}
              body={bodyText}
              emphasis={emphasis}
              header={headerText}
              isDismissable={isDismissable}
              style={"current"}
            />
          </div>
          <div className="example">
            <p className="label">New</p>
            <Alert
              action={actionLabel}
              body={bodyText}
              emphasis={emphasis}
              header={headerText}
              iconColor={iconColor}
              isDismissable={isDismissable}
              lighterBackground={lighterBackground}
              stroke={stroke}
              style={"new"}
            />
          </div>
        </div>
      </div>
    </div >
  );
}

export default App;
